/*Table structure for table `cm_parameter` */

DROP TABLE IF EXISTS `cm_parameter`;

CREATE TABLE `cm_parameter` (
  `par_id` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '参数id',
  `par_pid` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '参数父id',
  `par_type` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '参数类型',
  `par_level` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '参数层级',
  `par_key` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '参数名称',
  `par_value` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '参数值',
  `group_id` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '参数组id',
  `sort_code` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '参数组内排序编号',
  `allow_del` decimal(1,0) DEFAULT NULL COMMENT '允许删除',
  `allow_edit` decimal(1,0) DEFAULT NULL COMMENT '允许修改',
  `ct_time` datetime DEFAULT NULL COMMENT '创建时间',
  `ct_user_id` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '创建人',
  `up_time` datetime DEFAULT NULL COMMENT '修改时间',
  `up_user_id` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '修改人',
  `note` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '备注',
  `del` decimal(1,0) DEFAULT NULL COMMENT '删除标记',
  PRIMARY KEY (`par_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='参数表';

