/*Table structure for table `sys_log` */

DROP TABLE IF EXISTS `sys_log`;

CREATE TABLE `sys_log` (
  `log_id` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '日志ID',
  `op_type` decimal(8,0) DEFAULT NULL COMMENT '操作类型 1-select,2-update,3-delete',
  `op_content` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '操作内容',
  `res_url` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '访问地址',
  `user_id` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '操作人',
  `user_name` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '操作人姓名',
  `op_time` datetime DEFAULT NULL COMMENT '操作时间',
  `extend1` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '预留1',
  `extend2` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '预留2',
  `extend3` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '预留3',
  PRIMARY KEY (`log_id`)
