/*Table structure for table `sys_menu` */

DROP TABLE IF EXISTS `sys_menu`;

CREATE TABLE `sys_menu` (
  `menu_id` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '菜单id',
  `menu_pid` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '父级菜单',
  `menu_name` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '菜单名称',
  `menu_desc` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '菜单描述',
  `icon_url` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '菜单图标',
  `menu_type` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '菜单类型',
  `menu_url` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '菜单访问地址',
  `class_name` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '菜单整体样式',
  `left_icon_class` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '菜单左侧样式',
  `title_class` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '菜单标题样式',
  `right_icon_class` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '菜单右侧样式',
  `sort` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '排序',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `del` decimal(1,0) DEFAULT NULL COMMENT '删除标记',
  PRIMARY KEY (`menu_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='菜单表';

