/*Table structure for table `sys_privilege` */

DROP TABLE IF EXISTS `sys_privilege`;

CREATE TABLE `sys_privilege` (
  `pvg_id` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '权限ID',
  `pvg_pid` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '父权限ID',
  `pvg_name` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '权限名称',
  `pvg_type` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '权限类型',
  `pvg_desc` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '权限描述',
  `allow_edit` decimal(1,0) DEFAULT NULL COMMENT '允许编辑',
  `allow_del` decimal(1,0) DEFAULT NULL COMMENT '允许删除',
  `ct_user_id` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '创建人',
  `ct_time` datetime DEFAULT NULL COMMENT '创建时间',
  `up_user_id` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '修改人',
  `up_time` datetime DEFAULT NULL COMMENT '修改时间',
  `sort` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '排序编号',
  `note` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '备注',
  `del` decimal(1,0) DEFAULT NULL COMMENT '删除标记',
  PRIMARY KEY (`pvg_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='权限表';

