/*Table structure for table `sys_resources` */

DROP TABLE IF EXISTS `sys_resources`;

CREATE TABLE `sys_resources` (
  `res_id` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '资源ID',
  `res_pid` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '父资源ID',
  `res_name` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '资源名称',
  `res_desc` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '资源描述',
  `res_icon` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '资源图标',
  `res_url` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '资源访问地址',
  `res_type` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '资源类型',
  `res_target` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '资源目标',
  `allow_edit` decimal(1,0) DEFAULT NULL COMMENT '允许编辑',
  `allow_del` decimal(1,0) DEFAULT NULL COMMENT '允许删除',
  `ct_user_id` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '创建人',
  `ct_time` datetime DEFAULT NULL COMMENT '创建时间',
  `up_user_id` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '修改人',
  `up_time` datetime DEFAULT NULL COMMENT '修改时间',
  `sort` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '排序编号',
  `note` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '备注',
  `del` decimal(1,0) DEFAULT NULL COMMENT '删除标记',
  PRIMARY KEY (`res_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='菜单按钮表';

