/*Table structure for table `sys_role` */

DROP TABLE IF EXISTS `sys_role`;

CREATE TABLE `sys_role` (
  `role_id` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '角色ID',
  `role_pid` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '父级角色ID',
  `role_name` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '角色名称',
  `role_desc` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '角色描述',
  `role_type` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '角色类型',
  `allow_edit` decimal(1,0) DEFAULT NULL COMMENT '允许编辑',
  `allow_del` decimal(1,0) DEFAULT NULL COMMENT '允许删除',
