  `theme` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '系统主题',
  `office` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '职位',
  `tel` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '手机号',
  `email` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '电子邮箱',
  `login_count` decimal(8,0) DEFAULT NULL COMMENT '登录次数',
  `photo` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '头像',
  `birthday` date DEFAULT NULL COMMENT '出生日期',
  `ct_user_id` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '创建用户',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `up_user_id` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '修改用户',
  `up_time` datetime DEFAULT NULL COMMENT '修改时间',
  `login_time` datetime DEFAULT NULL COMMENT '登录时间',
  `last_login_time` datetime DEFAULT NULL COMMENT '上次登录时间',
  `que_answer` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '密码提示答案',
  `enable_position` decimal(1,0) DEFAULT NULL COMMENT '是否启用职位',
  `role_enable_type` decimal(1,0) DEFAULT NULL COMMENT '角色启用类型',
