/* Function  structure for function  `getChilds` */

/*!50003 DROP FUNCTION IF EXISTS `getChilds` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`smertbox`@`%` FUNCTION `getChilds`(rootId VARCHAR(200)) RETURNS varchar(1000) CHARSET utf8 COLLATE utf8_bin
BEGIN
      DECLARE sTemp VARCHAR(1000);
      DECLARE sTempChild VARCHAR(1000);
    
       SET sTemp = '$';
       SET sTempChild = rootId;
    
       WHILE sTempChild is not null DO
         SET sTemp = concat(sTemp,',',sTempChild);
         SELECT group_concat(menu_id) INTO sTempChild FROM sys_menu where FIND_IN_SET(menu_pid,sTempChild)>0;
       END WHILE;
       
       RETURN sTemp;
     END */$$
DELIMITER ;

/* Function  structure for function  `queryChildrenParam` */

/*!50003 DROP FUNCTION IF EXISTS `queryChildrenParam` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`smertbox`@`%` FUNCTION `queryChildrenParam`(parId VARCHAR(200)) RETURNS varchar(4000) CHARSET utf8 COLLATE utf8_bin
BEGIN
	DECLARE sTemp VARCHAR(1000);
	DECLARE sTempChild VARCHAR(1000);
    
	SET sTemp = '$';
	SET sTempChild = parId;
    
	WHILE sTempChild IS NOT NULL DO
         SET sTemp = CONCAT(sTemp,',',sTempChild);
         SELECT GROUP_CONCAT(par_id) INTO sTempChild FROM cm_parameter WHERE FIND_IN_SET(par_pid,sTempChild)>0;
	END WHILE;
       
	return sTemp;
    END */$$
DELIMITER ;

